import Card from "../Components/Card/card";
import DefaultLayout from "../Layouts/DefaultLayout";

export default function Home() {
    return (
        <DefaultLayout>
            <div className="ml-auto mr-auto flex items-center justify-center h-screen p-2 gap-4">
                <h1 className="text-lg text-gray-700 font-medium">Welcome, Arianny Mendoza</h1>
                <div>
                
                </div>
                <div>
                    <input type="button" className="" value="Active"/>
                    <input type="button" className="" value="Pending"/>
                    <input type="button" className="" value="Expired"/>
                </div>
            </div>
        </DefaultLayout>
    );
}
